          <h1>Defend the Endangered</h1>
          {/* <img src={earth} className="App-logo" alt="logo" /> */}
          <a>TBD: Informing the public about<br/>
            the consequences of human interference</a>
        </div>

        {/* Separating bar */}
        <div className = "Header_2">
            <p> header number 2 </p>
        </div>
      </div>
    );
}
export default Header
